var $feed_url="ENTER FEED URL",$symbol="ENTER SYMBOL",$exchange="ENTER EXCHANGE";var request=new XMLHttpRequest;request.open("GET",$feed_url,true);request.onload=function(){if(request.status>=200&&request.status<400){var data=JSON.parse(request.responseText);embedQuoteBox(data)}else{console.log("Feed not available")}};request.send();function embedQuoteBox(data){var quoteDiv=document.getElementById("eq-quote-box");quoteDiv.innerHTML='\r\n        <div class="stock-data">\r\n    		<div class="ir-quote-box">\r\n    			<div class="single-stock-info">\r\n    				<span class="pull-right">'+$symbol+'</span>\r\n    				Symbol\r\n    			</div>\r\n    			<div class="separator" style="border-bottom:1px dotted #e9e9e9;margin:20px 0;"></div>\r\n    			<div class="single-stock-info">\r\n    				<span class="pull-right">'+$exchange+'</span>\r\n    				Market\r\n    			</div>\r\n    			<div class="separator" style="border-bottom:1px dotted #e9e9e9;margin:20px 0;"></div>\r\n    			<div class="single-stock-info market-cap">\r\n    				<span class="pull-right" id="data-market-cap"></span>\r\n    				Market Cap\r\n    			</div>\r\n    			<div class="separator" style="border-bottom:1px dotted #e9e9e9;margin:20px 0;"></div>\r\n    			<div class="single-stock-info price">\r\n    				<span class="pull-right" id="data-price"></span>\r\n    				Price\r\n    			</div>\r\n    			<div class="separator" style="border-bottom:1px dotted #e9e9e9;margin:20px 0;"></div>\r\n    			<div class="single-stock-info change">\r\n    				<span class="pull-right" id="data-change"></span>\r\n    				Change\r\n    			</div>\r\n    			<div class="separator" style="border-bottom:1px dotted #e9e9e9;margin:20px 0;"></div>\r\n    			<div class="single-stock-info volume">\r\n    				<span class="pull-right" id="data-volume"></span>\r\n    				Volume\r\n    			</div>\r\n    		</div>\r\n        </div>';var market_cap=document.getElementById("data-market-cap"),price=document.getElementById("data-price"),change=document.getElementById("data-change"),volume=document.getElementById("data-volume");if(data.market_cap!="N/A"){market_cap.innerHTML="$"+data.market_cap}else{market_cap.innerHTML=data.market_cap}if(data.last!="N/A"){price.innerHTML="$"+data.last}else{price.innerHTML=data.last}change.innerHTML=data.change;if(!data.volume){volume.innerHTML="0"}else{volume.innerHTML=data.volume}}